import Content from './Content';
import Foreigner from './Foreigner';
import Testimonials from './Testimonials';

const Home=()=>{
    let bgstyle={
        backgroundColor:'black',
    }
    return(
        <div style={bgstyle}>
            <h1>This is Sparta!!</h1>
            <h1><Foreigner name="Vinayak Santhosh"/></h1>
            <button onClick={bgstyle}>Enable Dark Mode</button>
        </div>
    )
}

export default Home;
